import { Box, Button, Grid, Typography } from '@mui/material';
import vegetables from '../assets/vegetables.svg'

export const HomeScreen = () => {
  return (
    <>
      <Grid
        container
      >
        <Grid
          item
          xs={12}
          sm={6}
          order={{ xs: 2, sm: 1 }}
          sx={{
            display: "flex", flexDirection: "column"
          }}
        >
          <Box
            m="auto"
            sx={{
              // height: '233',
              // width: 350,
              // maxHeight: { xs: '100%', sm: '100%', md: '100%', lg: '100%' },
              // maxWidth: { xs: 350, md: 250 },
              minHeight: { xs: 300, md: 150 },
              minWidth: { xs: 300, md: 150 },
              marginBottom: {xs: 4}
            }}
          >
            <Typography variant='h3'>Healthy Food</Typography>
            <Typography variant='h3'>For Us!!</Typography>
            <Typography variant="body1" color={'primary'} fontSize={22} sx={{ mt: 3 }}>What better way to eat if is</Typography>
            <Typography variant="body1" fontSize={22}>healthy, our bodies</Typography>
            <Typography variant="body1" fontSize={22}>will thank you.</Typography>

            <Button variant="contained" color={'secondary'}
              sx={{
                mt: 5,
                ml: 15,
                textTransform: 'initial',
                height: 50,
                width: 150,
                borderRadius: 3,
                color: 'white',
                fontSize: 22,
                fontWeight: 900
              }}>
              Get in
            </Button>
          </Box>

        </Grid>
        <Grid item xs={12} sm={6} order={{ xs: 1, sm: 2 }}>
          <Box
            component="img"

            // xs, extra-small: 0px
            // sm, small: 600px
            // md, medium: 900px
            // lg, large: 1200px
            // xl, extra-large: 1536px

            sx={{
              // height: '233',
              // width: 350,
              maxHeight: { xs: '100%', sm: '100%', md: '100%', lg: '100%' },
              // maxWidth: { xs: 350, md: 250 },
              minHeight: { xs: 300, md: 150 },
              minWidth: { xs: 350, md: 150 }
            }}
            alt="vegetables_image"
            src={`${vegetables}`}
          />
        </Grid>
      </Grid>
    </>
  )
}
